import React from 'react'
import logo from '../images/logo/white.png'

export default function Footer() {
  return (
    <div className="footer">
      <img className="footer-logo" src={logo} alt="footer logo" />
      <div>Preception &copy; 2018</div>
    </div>
  )
}
